Lonely Planet Discover Caribbean Islands is your passport to the most relevant, up-to-date advice on what to see and skip, and what hidden discoveries await you.

Swim below the waters with darting fish, wander along the sand and stop at a lazy beach bar, or hike into emerald wilderness; all with your trusted travel companion. Get to the heart of the Caribbean Islands and begin your journey now!
